import React from 'react'
import CollectionCard from './CollectionCard'

let PunkList = ({ punkListData }) => {
    return (
        <div className="punkList">
            {punkListData.map(punk => (
                <div>
                    <CollectionCard
                    key={punk.token_id}
                    id={punk.token_id}
                    name={punk.name}
                    traits={punk.traits}
                    image={punk.image_original_url}
                    ></CollectionCard>
                </div>
            ))}

        </div>
    )
}

export default PunkList
